import React, { Component } from 'react'
import API from '../utils/API';


class Search extends Component {
    state = {
        search: '',
        movies: [],
        results: []
    }


componentDidMount() {
    API.getMovies()
    .then(res => this.setState({ movies: res.data.message }))
    .catch(err => console.log(err))
  }

render() {
    return (
        <div className=''>
            <h1>{movies}</h1>
        </div>
    )
}
}

export default Search;
